import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => (
    <section style={{backgroundColor:"#FEFCF3"}}>
    <div className='container' style={{backgroundColor:"#FEFCF3"}}>
        <div className='jumbotron mt-5' style={{backgroundColor:"#F0DBDB"}}>
            <h1 class='display-4'>Welcome to AlphaCours</h1>
            <p class='lead'>This is where you will devlop your skills in any field of your educational life!</p>
            <hr class='my-4' />
            <p>Click the Log In button</p>
            <Link class='btn btn-primary btn-lg' to='/login' role='button'>Login</Link>
        </div>
    </div>
    <br/>
    </section>
);

export default Home;
